import { navData } from "../../constants/data"

const NavData = () => {
  return (
    <div className="flex text-center ">
      <div className="text-4xl ml-12 ">Best food</div>
        {
            navData.map(item=>(
              <div className="pl-6">
                <img className="h-24" src={item.url} alt="shopping"/>
                <p>{item.text}</p>
              </div>
            ))
        }
    </div>
  )
}

export default NavData
